import React from "react";

export const Task = ({ allTasks }) => {
  return allTasks.map((task) => (
    <div className="task">
      <h3>{task.title}</h3>
      <button className="delete">Delete</button>
      <button className="complete">Complete</button>
    </div>
  ));
};
